import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import PageLayout from './PageLayout';

const MetricsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(175px, 1fr));
  gap: 15px;
  margin-bottom: 30px;
`;

const MetricCard = styled.div`
  background: linear-gradient(135deg, #f8f9fa 0%, #e9ecef 100%);
  border-radius: 12px;
  padding: 15px;
  border: 1px solid #dee2e6;
  transition: transform 0.3s ease;
  cursor: pointer;
  box-shadow: 0 4px 15px rgba(0, 0, 0, 0.1);

  &:hover {
    transform: translateY(-3px);
    background: linear-gradient(135deg, #e9ecef 0%, #dee2e6 100%);
    border-color: #1a5f3c;
    box-shadow: 0 6px 20px rgba(26, 95, 60, 0.2);
  }
`;

const MetricTitle = styled.h3`
  color: #2c3e50;
  font-size: 1rem;
  margin-bottom: 10px;
  font-weight: 600;
  text-align: center;
`;

const MetricValue = styled.div`
  color: #1a5f3c;
  font-size: 1.3rem;
  font-weight: 700;
  margin-bottom: 8px;
  text-align: center;
`;

const MetricChange = styled.div`
  color: ${props => props.isPositive ? '#1a5f3c' : '#e74c3c'};
  font-size: 0.9rem;
  font-weight: 500;
  text-align: center;
`;

const RefreshButton = styled.button`
  background: linear-gradient(135deg, #1a5f3c 0%, #2d7a4f 100%);
  border: none;
  border-radius: 10px;
  padding: 12px 24px;
  color: white;
  font-size: 1rem;
  font-weight: 600;
  cursor: pointer;
  transition: all 0.3s ease;
  margin-bottom: 20px;
  box-shadow: 0 4px 15px rgba(26, 95, 60, 0.3);

  &:hover {
    background: linear-gradient(135deg, #134a30 0%, #1a5f3c 100%);
    transform: translateY(-2px);
    box-shadow: 0 6px 20px rgba(26, 95, 60, 0.4);
  }
`;

const ClickHint = styled.div`
  text-align: center;
  color: #7f8c8d;
  font-size: 0.9rem;
  margin-top: 20px;
  font-style: italic;
`;

// Ïà´Ïûê Ìè¨Îß∑ÌåÖ Ìï®Ïàò
const formatNumber = (value, decimals = 2) => {
  if (value === null || value === undefined || isNaN(value)) {
    return 'N/A';
  }
  
  const roundedValue = Math.round(value * Math.pow(10, decimals)) / Math.pow(10, decimals);
  
  return roundedValue.toLocaleString('ko-KR', {
    minimumFractionDigits: decimals,
    maximumFractionDigits: decimals
  });
};

// ÌçºÏÑºÌä∏ Ìè¨Îß∑ÌåÖ Ìï®Ïàò
const formatPercent = (value, decimals = 2) => {
  if (value === null || value === undefined || isNaN(value)) {
    return 'N/A';
  }
  
  const sign = value >= 0 ? '+' : '';
  const formattedValue = formatNumber(Math.abs(value), decimals);
  
  return `${sign}${formattedValue}%`;
};

const FixedIncomePage = () => {
  // ÎçîÎØ∏ Îç∞Ïù¥ÌÑ∞ (Ïã§Ï†ú API Ïó∞ÎèôÏãú ÍµêÏ≤¥)
  const bondMetrics = [
    // Standard Interest Rates (Í∏∞Ï§Ä Í∏àÎ¶¨)
    { title: 'ÎØ∏Íµ≠ Í∏∞Ï§Ä Í∏àÎ¶¨', value: '5.50%', change: '0.00%', isPositive: true, symbol: '^TNX' },
    { title: 'Ïú†Î°ú Í∏∞Ï§Ä Í∏àÎ¶¨', value: '4.50%', change: '0.00%', isPositive: true, symbol: '^BUND' },
    { title: 'ÏùºÎ≥∏ Í∏∞Ï§Ä Í∏àÎ¶¨', value: '-0.10%', change: '0.00%', isPositive: false, symbol: '^TNX' },
    { title: 'ÌïúÍµ≠ Í∏∞Ï§Ä Í∏àÎ¶¨', value: '3.50%', change: '0.00%', isPositive: true, symbol: '^TNX' },
    { title: 'Ïä§ÏúÑÏä§ Í∏∞Ï§Ä Í∏àÎ¶¨', value: '1.75%', change: '0.00%', isPositive: true, symbol: '^TNX' },
    { title: 'ÏòÅÍµ≠ Í∏∞Ï§Ä Í∏àÎ¶¨', value: '5.25%', change: '0.00%', isPositive: true, symbol: '^TNX' },
    { title: 'Ìò∏Ï£º Í∏∞Ï§Ä Í∏àÎ¶¨', value: '4.35%', change: '0.00%', isPositive: true, symbol: '^TNX' },
    { title: 'Î∏åÎùºÏßà Í∏∞Ï§Ä Í∏àÎ¶¨', value: '12.25%', change: '0.00%', isPositive: true, symbol: '^TNX' },
    
    // Bond Yields by Maturity
    { title: 'US 3M', value: '5.45%', change: '+0.02%', isPositive: true, symbol: '^IRX' },
    { title: 'US 2Y', value: '4.78%', change: '+0.05%', isPositive: true, symbol: '^UST2YR' },
    { title: 'US 10Y', value: '4.25%', change: '+0.08%', isPositive: true, symbol: '^TNX' },
    { title: 'US 30Y', value: '4.45%', change: '+0.12%', isPositive: true, symbol: '^TYX' },
    
    { title: 'Korea 2Y', value: '3.45%', change: '+0.03%', isPositive: true, symbol: '^TNX' },
    { title: 'Korea 3Y', value: '3.52%', change: '+0.04%', isPositive: true, symbol: '^TNX' },
    { title: 'Korea 5Y', value: '3.68%', change: '+0.06%', isPositive: true, symbol: '^TNX' },
    { title: 'Korea 10Y', value: '3.85%', change: '+0.08%', isPositive: true, symbol: '^TNX' },
    { title: 'Korea 30Y', value: '4.12%', change: '+0.10%', isPositive: true, symbol: '^TNX' },
    
    { title: 'Japan 2Y', value: '0.12%', change: '+0.01%', isPositive: true, symbol: '^TNX' },
    { title: 'Japan 3Y', value: '0.15%', change: '+0.02%', isPositive: true, symbol: '^TNX' },
    { title: 'Japan 5Y', value: '0.25%', change: '+0.03%', isPositive: true, symbol: '^TNX' },
    { title: 'Japan 10Y', value: '0.45%', change: '+0.05%', isPositive: true, symbol: '^TNX' },
    { title: 'Japan 30Y', value: '1.25%', change: '+0.08%', isPositive: true, symbol: '^TNX' },
    
    { title: 'Germany 2Y', value: '3.12%', change: '+0.04%', isPositive: true, symbol: '^BUND' },
    { title: 'Germany 3Y', value: '3.25%', change: '+0.05%', isPositive: true, symbol: '^BUND' },
    { title: 'Germany 5Y', value: '3.45%', change: '+0.06%', isPositive: true, symbol: '^BUND' },
    { title: 'Germany 10Y', value: '2.85%', change: '+0.08%', isPositive: true, symbol: '^BUND' },
    { title: 'Germany 30Y', value: '3.15%', change: '+0.10%', isPositive: true, symbol: '^BUND' }
  ];

  // Ï±ÑÍ∂å ÏßÄÌëú ÌÅ¥Î¶≠ Ìï∏Îì§Îü¨ - Yahoo Finance ÌéòÏù¥ÏßÄ Ïó¥Í∏∞
  const handleBondClick = (symbol) => {
    const yahooFinanceUrls = {
      '^TNX': 'https://finance.yahoo.com/quote/%5ETNX/chart?p=%5ETNX&t=ytd',
      '^IRX': 'https://finance.yahoo.com/quote/%5EIRX/chart?p=%5EIRX&t=ytd',
      '^UST2YR': 'https://finance.yahoo.com/quote/%5EUST2YR/chart?p=%5EUST2YR&t=ytd',
      '^TYX': 'https://finance.yahoo.com/quote/%5ETYX/chart?p=%5ETYX&t=ytd',
      '^BUND': 'https://finance.yahoo.com/quote/%5EBUND/chart?p=%5EBUND&t=ytd'
    };
    
    const url = yahooFinanceUrls[symbol];
    if (url) {
      window.open(url, '_blank', 'noopener,noreferrer');
    }
  };

  return (
    <PageLayout title="Fixed Income">
      <RefreshButton onClick={() => window.location.reload()}>
        üîÑ Îç∞Ïù¥ÌÑ∞ ÏÉàÎ°úÍ≥†Ïπ®
